import React from 'react'
import Card from './Card'
import Navigation from './Navigation'
const events=[{
    name:'Jhon',
    location:'Jbeil',
    id:'1',
    image:''
}]

function Events() {
  return (
    <div>
    <Navigation/>
    <Card name={events.name} image={events.image} key={events.id} location={events.location} events={events} />

    </div>
  )
}

export default Events
